syntax = "proto3";
package b;

message SearchRequest {
    nested n1 = 1;
}

message nested {
    string n1 = 1;
}

message SearchResponse {
    string response = 1;
}

message SuggestResultRequest {
    string s1 = 1;
    string s2 = 2;
    string s3 = 3;
    string s4 = 4;
    string s5 = 5;
}

message SuggestResultResponse {}
